    useEffect(() => {
      axios.get(Url)
      .then(res => console.log(setProductData(res.data)))
      .catch(err => console.log(err.message))

    },[Url])



  return (
      <main className="productmain">
       <div className="topicons">
         <input type="search" placeholder='Search' />
          <div className="">

          <h3 className="text-2xl">Hello Abrorbek</h3>
          <img src='' alt="" srcset="" />
          </div>

     </div>


    <div className="productbox">

    <h1>React Modal Misol</h1>
      <button className='openmodal' onClick={openModal}>Add Product</button>
      <Modal isOpen={modalIsOpen} onClose={closeModal} />

      <div class="table-container">
        <table>
            <thead>
                <tr>
                  <th>#</th>
                  <th>Name</th>
                  <th>Email</th>
                  <th>Phone</th>
                  <th>Age</th>
                  <th>City</th>
                  <th>Address</th>
                </tr>
            </thead>
            <tbody>

                {
                   res[data].map(item => {
                        return (
                            <tr key={item.id}>
                                <td>{item.id}</td>
                                <td>{item.name}</td>
                                <td>{item.email}</td>
                                <td>{item.phone}</td>
                                <td>{item.age}</td>
                                <td>{item.city}</td>
                                <td>{item.address}</td>
                            </tr>
                        )

                   })
                }


            </tbody>
        </table>
    </div>
    </div>


      </main>
  );
};

export default Productmain;
